import './App.css';

import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
import {connect} from "react-redux"
import {setCryptoData, addCryptoData} from "./store/actions/actionCreators";
import CryptoRankingPage from './store/components/CryptoRankingPage/CryptoRankingPage';

function App(props) {





  return (


    <div className="App">
      <Router>

        <Route exact path ="/" component={CryptoRankingPage}/>
      </Router>

    </div>
  );
}

const mapStateToProps = (state)=> {
  return {
    cryptoData:  state.cryptoData
  }
}

export default connect(mapStateToProps, {setCryptoData, addCryptoData})(App);
